import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-viewers-card',
  templateUrl: './viewers-card.component.html',
  styleUrls: ['./viewers-card.component.scss']
})
export class ViewersCardComponent {
  @Input() nombreUsuario: string;
  @Input() idUsuario: number;
  @Input() email: string;
  @Input() cargo: string;
  @Input() imagenUsuario: string;

}
<div class="card">
  <img class="card-img-top" [src]="imagenUsuario" alt="Imagen de usuario">
  <div class="card-body">
    <h5 class="card-title">{{ nombreUsuario }}</h5>
    <p class="card-text">ID: {{ idUsuario }}</p>
    <p class="card-text">Email: {{ email }}</p>
    <p class="card-text">Cargo: {{ cargo }}</p>
  </div>
</div>
